import React from 'react';

import { faTwitterSquare, faFacebookF, faInstagram } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import './Footer.css'

const Footer = () =>{
  return(
    <div className='container bg-light text-center my-4'>
      <h3 className='py-3 text-bold'>Follow Us!</h3>
      <div className='d-flex justify-content-center'>
        <div className='px-4' ><FontAwesomeIcon size='2x' icon={faTwitterSquare}/></div>
        <div className='px-4' ><FontAwesomeIcon size='2x' icon={faFacebookF}/></div>
        <div className='px-4' ><FontAwesomeIcon size='2x' icon={faInstagram}/></div>
      </div>
      <h6 className='my-4'> 2020 by Tactile Tots NJ</h6>
    </div>
  )
}

export default Footer
